import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import './App.css';

import Login from './my/login.js';
import Register from './my/register.js';
import LearnMore from './my/unfinished.js';
import Todo from './my/todo.js';

class App extends Component {
  constructor() {
    super();
    this.state = {
      user: {}
    };
  }
  componentDidMount(){
    const url = 'http://localhost:8081/user/checkUser';
    fetch(url, {
      method: 'POST', // or 'PUT'
      headers: new Headers({
	'Content-Type': 'application/json'
      })
    }).then(res => res.json())
      .catch(error => console.error('Error:', error))
      .then((response) => {
	this.setState({user: response});
	return console.log('Success:App', response);
      });
  }
  render() {
    return (
      <Router>
	<div className="App">
	  <Route exact path="/" component={Todo} />
	  <Route path="/login" component={Login} />
	  <Route path="/register" component={Register} />
	  <Route path="/unfinished" component={LearnMore} />
	</div>
      </Router>
    );
  }
}

export default App;
